import styled from '@emotion/styled';

export const Container = styled.div`
  max-width: 460px;

  display: flex;
  flex-direction: column;
  justify-content: flex-start;
  align-items: stretch;

  margin: 0 auto;
  margin-top: 10px;
  /* padding: 5px; */
  width: 90%;
  font-size: 16px;
  color: white;

  gap: 40px;
`;
